    <h2>瑞士医疗保险基础险的不同价格</h2>
    <div class="descr">2017年各州和不同保险公司针对一位成年人，自保金500瑞郎，不包括事故保险的每月基础保险费用：各州按人头计算出一个中间值，瑞士共有63家医疗保险公司，灰线代表各州的中间值。</div>
